    type: GET_LIST_DISTRICT,
  };
};

export const setListDistrict = (payload) => {
  return {
    type: SET_LIST_DISTRICT,
    payload,
  };
};

export const getListCommune = () => {
  return {
    type: GET_LIST_COMMUNE,
  };
};

export const setListCommune = (payload) => {
  return {
    type: SET_LIST_COMMUNE,
    payload,
  };
};
